import React,{Component} from "react";
import ReactDOM from "react-dom";
import Iframe from 'react-iframe'


class MarineTrafficMap extends Component {
  componentDidMount() {
    const script = document.createElement("script");
    script.async = true;
    script.src = "http://www.marinetraffic.com/js/embed.js";
    document.body.appendChild(script);
  }
  render() {
    return (
        <div>
<Iframe url="http://www.youtube.com/embed/xDMP3i36naA"
        width="450px"
        height="450px"
        id="myId"
        className="myClassname"
        display="initial"
        position="relative"/>
          <iframe src="https://www.marinetraffic.com/en/ais/home/centerx:-12.0/centery:25.0/zoom:4" width="100%" height="450" frameborder="0" style={{border:0}} allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>
        </div>
    );
  }
}

export default MarineTrafficMap;
